import ReactDOM from 'react-dom';
import React from 'react';

const dom = document.getElementById('root');

const Main = (_props) => {
  return (
    <section>
      <h1>CoderDojo Gotanda</h1>
      <p><a href="https://coderdojo-gotanda.doorkeeper.jp/">参加する</a></p>
    </section>
  );
};

ReactDOM.render(<Main />, dom);
